                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            I  ”“•  ij–{C  D^‚O‚P‚Q‚R‚S‚T‚U‚V‚W‚XFGƒ„H—‚`‚a‚b‚c‚d‚e‚f‚g‚h‚i‚j‚k‚l‚m‚n‚o‚p‚q‚r‚s‚t‚u‚v‚w‚x‚ym  nOQM‚‚‚‚ƒ‚„‚…‚†‚‡‚‚‰‚‚‹‚‚‚‚‚‚‘‚’‚“‚”‚•‚–‚—‚‚™‚obp                                                                                                                                                                                                                                                                          P                                                      ";
	static function conv($sd) {
		$s = new StringBuf();
		{
			$_g1 = 0;
			$_g = haxe_Utf8::length($sd);
			while($_g1 < $_g) {
				$i = $_g1++;
				$v = haxe_Utf8::charCodeAt($sd, $i);
				if($v < 256) {
					$s->b .= _hx_string_or_null(chr($v));
				} else {
					$tmp = _hx_substr(charconv_UTF8ToSJIS::$codeTable, ($v - 256) * 2, 2);
					$s->add($tmp);
					unset($tmp);
				}
				unset($v,$i);
			}
		}
		return $s->b;
	}
	function __toString() { return 'charconv.UTF8ToSJIS'; }
}
